import React, { Component } from 'react';
class Header extends Component {
    render() {
        return (
            <div>
                <div className="fa fa-car"></div>
                <img className="icon_header" src="https://i.imgur.com/KjXX84B.png" alt=""></img>
            </div>
        );
    }
}

export default Header;
